css:
.nuclide-ui-expression-tree-value {
  display: inline-block;
  width: 100%;
  margin-left: 10px;
}
.nuclide-ui-expression-tree-value .list-tree li:not(.list-nested-item) {
  line-height: 1.6em;
  word-wrap: break-word;
}
.nuclide-ui-expression-tree-value div.list-item > div {
  display: inline-block;
}
.nuclide-ui-expression-tree-value-container {
  width: 100%;
  padding-right: 1em;
  word-wrap: break-word;
}
.nuclide-ui-expression-tree-value-treelist {
  width: 100%;
}
.nuclide-ui-expression-tree-value-spinner {
  min-height: 15px;
}
